import React from "react";
import {
  Button,
  Card,
  CardActionArea,
  CardActions,
  CardContent,
  CardMedia,
  Typography,
} from "@mui/material";
import Chip from "@mui/material/Chip";
import { Box } from "@mui/system";

const Project = ({ projects }) => {
  return (
    <div>
      {projects && project.map((project) => (
        <Card key={project.id} sx={{ maxWidth: 375, margin: "1rem", background: "linear-gradient(to right, #f5f5f5, #e5e5e5)" }}>
          <CardActionArea>
            <CardMedia component="img" image={project.img} sx={{ height: 200 }} />
            <CardContent>
              <Typography gutterBottom variant="h5" component="div">
                {project.title}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                {project.description}
              </Typography>
            </CardContent>
          </CardActionArea>
          <CardActions sx={{ display: "flex", flexDirection: "column" }}>
            <Box
              sx={{
                width: "100%",
                display: "flex",
                justifyContent: "space-around",
                mx: "auto",
                mb: 3,
              }}
            >
              <Button
                size="small"
                style={{ backgroundColor: "#1976D2", color: "#fff", fontWeight: "bold" }}
                variant="contained"
                href={project.source}
                target="_blank"
              >
                Source Code
              </Button>
              <Button
                size="small"
                style={{ backgroundColor: "#4CAF50", color: "#fff", fontWeight: "bold" }}
                variant="contained"
                href={project.liveVersion}
                target="_blank"
              >
                Live Version
              </Button>
            </Box>

            <Box
              sx={{
                width: "100%",
                display: "flex",
                justifyContent: "center",
                flexWrap: "wrap",
                gap: "1rem",
                mb: 2,
              }}
            >
              {project.tags.map((tag) => (
                <Chip label={tag} variant="outlined" key={tag} style={{ borderColor: "#1976D2", color: "#1976D2", fontWeight: "bold" }} />
              ))}
            </Box>
          </CardActions>
        </Card>
      ))}
    </div>
  );
};

export default Project;
